import { useNavigate } from 'react-router-dom';

import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

import './account.css';

const AccountPasswordReset = () => {
  let navigate = useNavigate();

  return <section className='accountSection'>
    <header>
      <h2>비밀번호 초기화</h2>
    </header>
    <aside className='accountAside'>
      <Form>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>가입 시 사용한 이메일 주소</Form.Label>
          <Form.Text>
            해당 이메일 주소와 연결된 계정이 있으면 해당 계정의 비밀번호를 초기화할 수 있는 메일을 보내드려요.
            메일이 전송되는데 시간이 걸릴 수 있어요.
          </Form.Text>
          <Form.Control type="email" placeholder="someone@example.com" />
          <br />
        </Form.Group>
        <div className='accountSubmitBtnContainer'>
          <Button variant="primary" type="submit">비밀번호 초기화하기</Button>
          <Button variant="outline-light" onClick={() => navigate('/account/signin')} >로그인하러 가기</Button>
        </div>
      </Form>
    </aside>
  </section>;
}

export { AccountPasswordReset };
